const zigbeeHerdsmanConverters = require('zigbee-herdsman-converters');

const exposes = zigbeeHerdsmanConverters.exposes;
const ea = exposes.access;
const e = exposes.presets;
const fz = zigbeeHerdsmanConverters.fromZigbeeConverters;
const tz = zigbeeHerdsmanConverters.toZigbeeConverters;

const ptvo_switch = zigbeeHerdsmanConverters.findByDevice({modelID: 'ptvo.switch'});
fz.legacy = ptvo_switch.meta.tuyaThermostatPreset;
fz.ptvo_on_off = {
  cluster: 'genOnOff',
  type: ['attributeReport', 'readResponse'],
  convert: (model, msg, publish, options, meta) => {
      if (msg.data.hasOwnProperty('onOff')) {
          const channel = msg.endpoint.ID;
          const endpointName = `l${channel}`;
          const binaryEndpoint = model.meta && model.meta.binaryEndpoints && model.meta.binaryEndpoints[endpointName];
          const prefix = (binaryEndpoint) ? model.meta.binaryEndpoints[endpointName] : 'state';
          const property = `${prefix}_${endpointName}`;
	  if (binaryEndpoint) {
            return {[property]: msg.data['onOff'] === 1};
          }
          return {[property]: msg.data['onOff'] === 1 ? 'ON' : 'OFF'};
      }
  },
};



const device = {
    zigbeeModel: ['PZEM004'],
    model: 'PZEM004',
    vendor: 'PZEM004',
    description: '[PZEM004](https://ptvo.info/zigbee-configurable-firmware-features/)',
    fromZigbee: [fz.ignore_basic_report, fz.ptvo_switch_analog_input,],
    toZigbee: [tz.ptvo_switch_trigger, tz.ptvo_switch_analog_input,],
    exposes: [e.current().withAccess(ea.STATE).withEndpoint('l1'),
      e.voltage().withAccess(ea.STATE).withEndpoint('l1'),
      e.energy().withUnit('Wh').withAccess(ea.STATE).withEndpoint('l1'),
      e.power().withAccess(ea.STATE).withEndpoint('l1'),
      exposes.numeric('frequency', ea.STATE).withEndpoint('l1').withUnit('Hz').withDescription('Frequency'),
      exposes.numeric('power_factor', ea.STATE).withEndpoint('l1').withUnit('cosf').withDescription('Power factor'),
      e.temperature().withEndpoint('l6'),
      e.humidity().withEndpoint('l6'),
      e.pressure().withUnit('Pa').withEndpoint('l6'),
],
    meta: {
        multiEndpoint: true,
        
    },
    endpoint: (device) => {
        return {
            l1: 1, l6: 6,
        };
    },
    icon: 'data:image/jpeg;base64,',
};

module.exports = device;
